Proud and honoured to be included as one of the fifteen #ForcesForChange featured on the cover of the September 2019 issue of @BritishVogue, guest-edited by HRH The Duchess of Sussex @SussexRoyal. Thank you @edward_enninful @gileshattersley @vanessakingori @ellie_pithers and the whole team at British Vogue for including me amongst these amazing women. On newsstands 2nd August.
...
Photographed by @TheRealPeterLindbergh, with fashion editors @Edward_Enninful and @TheRealGraceCoddington, hair by @BartPumpkin and @SergeNormant, make-up by @TheValGarland and @Diane.Kendal, nails by @LorraineVGriffin and @YukoTsuchihashi
...
For the first time the British Vogue cover is segmented into sixteen sections, one is a mirror and the other fifteen are dedicated to Forces For Change as selected by HRH The Duchess of Sussex. They are:
